    "2016-08-06T09:12:37.840306",nt"name": "crump-2003-selected-water-sample-results",nt"isopen":
    false,nt"url": null,nt"notes": "Point locations and water sampling results
    performed in 2003 by the Church Rock Uranium Monitoring Project (CRUMP) a consortium
    of organizations (Navajo Nation Environmental Protection Agency, US Environmental
    Protection Agency, New Mexico Scientific Laboratory Division, Navajo Tribal Utility
    Authority and NM Water Quality Control Commission). Samples include general description
    of the wells sampled, general chemistry, heavy metals and aestheic parameters, and
    selected radionuclides. Here only six sampling results are presented in this point
    shapefile, including: Gross Alpha (U-Nat Ref.) (pCi/L), Gross Beta (Sr/Y-90 Ref.)
    (pCi/L), Radium-226 (pCi/L), Radium-228 (pCi/L), Total Uranium (pCi/L), and Uranium
    mass (ug/L). The CRUMP samples were collected in the area of Churchrock, NM in the
    Eastern AUM Region of the Navajo Nation.",nt"license_title": null,nt"extras":
